import * as React from 'react';
import { Table, TableBody, TableCell, TableContainer, TableHead, TableRow, Paper } from '@material-ui/core';
import { Card, CardActions, CardContent, CardMedia, Button, Typography, Divider } from '@material-ui/core';
import DeleteIcon from '@material-ui/icons/Delete';
import EditIcon from '@material-ui/icons/Edit';

import { useDispatch } from 'react-redux';

import useStyles from '../../components/Postsp/Postp/styles';
import { deletePost } from '../../actions/posts';

function createData(name, calories, fat, carbs, protein) {
  return { name, calories, fat, carbs, protein };
}

const rows = [
  createData('Frozen yoghurt', 159, 6.0, 24, 4.0),
  createData('Ice cream sandwich', 237, 9.0, 37, 4.3),
  createData('Eclair', 262, 16.0, 24, 6.0),
  createData('Cupcake', 305, 3.7, 67, 4.3),
  createData('Gingerbread', 356, 16.0, 49, 2.0),
];

const pageTransaksi = ({ post, setCurrentId }) => {
  const dispatch = useDispatch();
  const classes = useStyles();
  const user = JSON.parse(localStorage.getItem('profile'));

  return (
    <TableContainer component={Paper}>
      <Table sx={{ minWidth: 650 }} aria-label="simple table">
        <TableHead>
          <TableRow>
            <TableCell>Nama Pegawai</TableCell>
            <TableCell align="right">Harga Pencucian</TableCell>
            <TableCell align="right">Total Mencuci</TableCell>
            <TableCell align="right">Total </TableCell>
            <TableCell align="right">Created By</TableCell>
            <TableCell align="right"></TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {rows.map((row) => (
            <TableRow
              key={row.name}
              sx={{ '&:last-child td, &:last-child th': { border: 0 } }}
            >
              <TableCell component="th" scope="row">
                {row.name}
              </TableCell>
              <TableCell align="right">{row.calories}</TableCell>
              <TableCell align="right">{row.fat}</TableCell>
              <TableCell align="right">{row.carbs}</TableCell>
              <TableCell align="right">{row.protein}</TableCell>
              <TableCell>
                <CardActions className={classes.cardActions} >
                  {(user?.result?._id === "62729e1306510726d49b02a2") && (
                    <Button size="small" color="primary" disabled={!user?.result} onClick={() => setCurrentId(post._id)}>
                      <EditIcon fontSize="small" />
                      Edit
                    </Button>
                  )}
                  {console.log(user?.result?._id)}
                  {(user?.result?._id === "62729e1306510726d49b02a2") && (
                    <Button size="small" color="secondary" disabled={!user?.result} onClick={() => dispatch(deletePost(post._id))}>
                      <DeleteIcon fontSize="small" />
                      Delete
                    </Button>
                  )}
                </CardActions>
              </TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
  )
}

export default pageTransaksi
